import static org.junit.Assert.*;

import java.util.ArrayList;

import junit.framework.Assert;

import org.junit.Rule;
import org.junit.Test;
import org.junit.rules.ExpectedException;


public class WordNetTest {
	private WordNet wordNet;
	
	/*public static void main(String[] args) {
		Result result = JUnitCore.runClasses(MyClassTest.class);
		    for (Failure failure : result.getFailures()) {
		      System.out.println(failure.toString());
		    }
		  }
		*/
	@Rule
	public ExpectedException exception = ExpectedException.none();
	@Test
	public void testCorrectWord() {
		ArrayList<String> result = new ArrayList<String>();
		result.add("apple");
		result.add("apple");
		Assert.assertEquals(result, wordNet.search("apple"));
	}
	@Test(expected = IllegalArgumentException.class)
	public void testNumbers() throws TestError {
		ArrayList<String> result = new ArrayList<String>();
		result.add(wordNet.search("abc123abc"));
		exception.expect(IllegalArgumentException.class);
		//Assert.assertEquals(expected, actual);
	}
	@Test(expected = NullPointerException.class)
	public void testNothing() throws TestError {
		ArrayList<String> result = new ArrayList<String>();
		result.add(wordNet.search(null));
		exception.expect(NullPointerException.class);
	}
	@Test(expected = OutOfMemoryError.class)
	public void testLongWord() throws TestError {
		ArrayList<String> result = new ArrayList<String>();
		result.add(wordNet.search(""));
		exception.expect(OutOfMemoryError.class);
	}
	@Test(expected = IllegalArgumentException.class)
	public void testEscapeChars() throws TestError {
		ArrayList<String> result = new ArrayList<String>();
		result.add(wordNet.search("apple \0 tree"));
		exception.expect(IllegalArgumentException.class);
	}
	@Test(expected = UnknownError.class)
	public void testSpecialChars() {
		ArrayList<String> result = new ArrayList<String>();
		result.add(wordNet.search("Aprs vous"));
		exception.expect(UnknownError.class);
	}
		
}
